import React from 'react'
import { Link } from "react-router-dom"

const MenuItem = ({ path, label }) => {
    return(
        <Link class="text-white rounded-xl inline-block mb-5 px-10 py-2 bg-blue-800 mx-3" to={path}>
            <button class="font-semibold">{label}</button>
        </Link>
    );
};

export default NavItem;
